// export default App;

import React, { useState } from "react";

const App = () => {
  const [command, setCommand] = useState("");

  const handleCommandChange = (e) => {
    setCommand(e.target.value);
  };

  const handleCommandSubmit = (e) => {
    e.preventDefault();
    // Process the command here (e.g., display portfolio, personal info, resume, contact information based on the command)
    // You can use conditional rendering or switch statement to determine what to display based on the command

    // Clear the command input field
    setCommand("");
  };

  return (
    <div>
      <h1>Command Line Interface</h1>

      <form onSubmit={handleCommandSubmit}>
        <span>$</span>
        <input type="text" value={command} onChange={handleCommandChange} />
        <button type="submit">Submit</button>
      </form>

      {/* Render different components based on the command */}
      {/* Example components: Portfolio, PersonalInfo, Resume, Contact */}

      {command === "portfolio" && <Portfolio />}
      {command === "personal-info" && <PersonalInfo />}
      {command === "resume" && <Resume />}
      {command === "contact" && <Contact />}
    </div>
  );
};

const Portfolio = () => {
  return (
    <div>
      <h2>Portfolio</h2>
      {/* Display portfolio content */}
    </div>
  );
};

const PersonalInfo = () => {
  return (
    <div>
      <h2>Personal Information</h2>
      {/* Display personal information */}
    </div>
  );
};

const Resume = () => {
  return (
    <div>
      <h2>Resume</h2>
      {/* Display resume content */}
    </div>
  );
};

const Contact = () => {
  return (
    <div>
      <h2>Contact Information</h2>
      {/* Display contact information */}
    </div>
  );
};

export default App;
